(1, 1305, '032301000009169', 'CARTUCHO DE FOGO CENTRAL, calibre 7,62 x 51 mm, com projetil comum.'),
(2, 3439, '040401000007709', 'SOLDA eletrica, eletrodo para aco carbono 46, rutilico, norma AWS E 6013 de 3,25 mm.\nEmbalagem: caixa com 20 kg.'),
(3, 3439, '040401000007719', 'SOLDA eletrica, eletrodo para aco carbono 46, rutilico, norma AWS E 6013 de 2,5mm.'),
(4, 3460, '073201000078899', 'MANDRIL DE SERRA COPO em aco, dimensoes 14 x 30 mm.\nEmbalagem individual em caixa, contendo dados de identificacao do produto, marca do fabricante, com certificado ISO 9000 ou superior.'),
(5, 3460, '073401000067789', 'MANDRIL DE SERRA COPO em aco, dimensoes 32 x 152 mm.\nEmbalagem individual em caixa, contendo dados de identificacao do produto, marca do fabricante, com certificado ISO 9000 ou superior.'),
(6, 3510, '081301000008529', 'CORREIA PARA CENTRIFUGADORA DE ROUPA, B-65'),
(7, 3540, '081301000008539', 'BOBINA PARA MAQUINA EMPACOTADORA, em pelicula de polietileno, dupla face, com 45 cm de largura, 30 Kg.\nEmbalagem em rolo, com dados de identificacao do produto, marca do fabricante, data de fabricacao e prazo de validade.'),
(8, 3610, '251000000051309', 'TINTA off-set, na cor preta europa'),
(9, 3610, '251000000053189', 'REVELADOR PARA CHAPA OFF-SET positivo'),
(10, 3610, '251000000053199', 'TINTA off-set rotativa vermelha.'),
(11, 3610, '251000000053289', 'MAQUINA encadernadora, manual, capacidade ate 20 folhas de uma so vez, comprimento maximo de perfuracao 63 furos (385 mm), diametro dos furos de no maximo 4 mm, matrizes e puncoes em aco temperado e reticado, contem margeador de profundidade com 4 posicoe'),
(12, 3610, '251000000053309', 'TINTA off-set, na cor magenta'),
(13, 3740, '251000000053319', 'PULVERIZADOR, costal, motorizado, para aplicacao de inseticida liquido, com controle de vazao regulavel de 60 a 208 ml/min, ultra baixo volume; motor a gasolina e oleo (motor dois tempos) que aciona a ventuinha a 7.000 rpm gerando cerca de 16 m3 de ar e p'),
(14, 3740, '251000000053379', 'PULVERIZADOR, multiuso, plastico resistente (polietileno e polipropileno), para uso domestico, capacidade 500 ml'),
(15, 3750, '251000000053389', 'TESOURA DE PODA para grama, cabo em madeira, comprimento total 40 cm.'),
(16, 3750, '251000000053399', 'TESOURA, poda, para grama, 12 polegadas, com presilha de PVC.'),
(17, 3750, '251000000053409', 'LAMINA, aco cromo vanadio, para maquina rocadeira stihl; dimensoes: 200 x 80 x 2 mm.'),
(18, 3770, '251000000053429', 'SERRA DE FITA, aco inox, para postear peixe, com motor blindado de 1,0 CV, tensao 110 volts.'),
(19, 3770, '251000000053439', 'ANCORA, modelo garateia, minimo de 5,0 e maximo de 6,0 Kg'),
(20, 3770, '251000000053449', 'CAIXA PARA TRANSPORTE DE ANIMAL, polipropileno, autoclavavel, com travas para empilhamento, com borda superior reforcada de 15mm de espessura, dimensoes 414mm ( comprimento) x 344mm (largura) x 168mm (altura).'),
(21, 3770, '251000000053459', 'TAMPA PARA GAIOLA, em arame inox, de camundongo, tamanho 414 x 344 mm e 6 mm de espaco entre os arames, com suporte para bebedouro e comedouro embutidos.'),
(22, 3770, '251000000053469', 'GAIOLA PARA COELHO, aco inox, com alcas para transporte e encaixe para bandeja, suporte para bebedouro, manjedoura e comedouro, bandeja para detrito, empilhavel, dimensoes 50 x 50 x 50 cm'),
(23, 3770, '251000000053539', 'CAMBAO, aco inox, para captura de caes, cabo de 1,5 m, cabo de aco encapado com borracha para nao machucar o animal e com empunhadura anatomica.'),
(24, 3770, '251000000053549', 'LINHA DE NYLON, lisa, para pesca, na cor branca, espessura de 0,40 mm.\nEmbalagem: rolo com 100 m.'),
(25, 3770, '251000000053559', 'LINHA DE NYLON, lisa, para pesca, na cor branca, espessura de 0,60 mm.\nEmbalagem: rolo com 100 m'),
(26, 3770, '251000000053569', 'LINHA DE NYLON, lisa, para pesca, na cor branca, espessura de 1,00 mm.\nEmbalagem: rolo com 100 m'),
(27, 3770, '251000000053579', 'REDE DE PESCA passagua, com fios de seda, com haste de aluminio, diametro de 30 cm, malha de 8,0 mm, para captura de peixe.'),
(28, 3920, '251000000053589', 'CARRO TRANSPORTE DE ROUPA, limpa, em fibra, cacamba com tampa, 2 rodizios fixos, 2 rodizios de giro livre, dimensoes 1000 x 600 x 800 mm.'),
(29, 3920, '251000000053599', 'CARRO PLATAFORMA, lastro em chapa de aco, capacidade 300 Kg, dimensoes 1,00 x 0,60 m., com suporte para locomocao, 02 rodizios giratorios e 02 rodizios fixos.'),
(30, 3920, '251000000053619', 'CARRO TRANSPORTE DE ALIMENTOS, termico, tampo superior, mesa auxiliar basculante em aco inoxidavel corpo em aluminio polido com painel de comando prateleira interdimensional e gavetas para talheres em aco inox, aquecido a seco atraves de resistencia em ac'),
(31, 3920, '251000000053639', 'CARRO TRANSPORTE DE ROUPA, umida, em plastico rigido, com registro na parte inferior para escoamento da agua, nas dimensoes de 1,00 x 0,60 x 0,80 m.'),
(32, 3920, '251000000053649', 'CARRO TIPO GAIOLA, capacidade para 600 litros, para transporte de material em almoxarifado, em aco inox ou liga de aco, dispositivos de destrava lateral, destrava para arrumacao, rodas em polipropileno.'),
(33, 3920, '251000000053659', 'CARRO TIPO GAIOLA, capacidade para 250 litros para transporte de material em almoxarifado, em aco inox ou liga de aco, dimensoes 54 x 90 x 88 cm, dispositivos de destrava lateral, destrava para arrumacao, rodas em polipropileno.'),
(34, 3920, '251000000053669', 'CARRO TRANSPORTE DE LABORATORIO, aco inox, 03 bandejas em plastico resistente, lisas e faceis de lavar (sendo 02 bandejas superiores com 60 cm de comprimento), rodas multidirecionais, dimensoes aproximadas de 120 x 50 x 100 cm.'),
(35, 3920, '251000000053679', 'CARRO DE MAO, capacidade 70 litros, para varricao, estrutura tubular, com 2 rodas, pneu borracha macica, conjugado com caixa de lixo.'),
(36, 3920, '251000000053689', 'CARRINHO TIPO SUPERMERCADO, capacidade minima 60 litros, estrutura tubular em aco galvanizado, 02 bandejas teladas, estrado, rodas com rolamentos, 02 rodas traseiras fixas, 02 rodizios dianteiros livres e giratorios.'),
(37, 3920, '251000000053699', 'CARRINHO TIPO SUPERMERCADO, capacidade minima 130 litros, estrutura tubular em aco galvanizado, simples com estrado, rodas com rolamentos, 02 rodas traseiras fixas, 02 rodizios dianteiros livres e giratorios.'),
(38, 3920, '251000018520703', 'CARRO PLATAFORMA, lastro em chapa de aco, capacidade 800 kg, dimensoes 0,80 x 1,50 m, rodas pneumaticas anteriores moveis e traseiras fixos, suporte para locomocao, com sistema de freio.'),
(39, 3920, '251000165807019', 'CARRO, esteira, em chapa de aco, com rodizios, medindo 44 x 86 cm, com 6 cm de altura.'),
(40, 3960, '251000165807029', 'CORREDICA para elevador modelo MM da marca Otis, dimensoes de 10 x 10 x 1,5 cm, para porta de pavimento X em baquelite.'),
(41, 3960, '251000165807039', 'ALAVANCA PARA ELEVADOR, modelo MM, marca Otis, em amianto, tipo cachorrinho, para trinco eletromecanico central da porta de pavimento com 20 cm.'),
(42, 3960, '251000165807049', 'KIT DE REPARO PARA ELEVADOR modelo MM, marca Otis, para fecho eletromecanico central composto de contatos primario, contatos secundarios, molas, eixos, borracha de amortecedor e rodana.'),
(43, 3990, '251000167907019', 'RODIZIO giratorio, referencia GLR 614TP, para carro plataforma.'),
(44, 4020, '251000167907029', 'BARBANTE, em fibra de algodao torcido, com 06 fios. \nEmbalagem: rolo com 250 gramas.'),
(45, 4020, '251000185207019', 'BARBANTE fibra de sisal torcido, com 125 fios.\nEmbalagem: rolo com 500 gramas.'),
(46, 4020, '251000185207029', 'CORDA DE SEDA para amarrar animais, 0,5 polegada\nEmbalagem: rolo com 50 metros'),
(47, 4110, '251001000053029', 'REFRIGERADOR industrial, vertical, 04 portas, dimensoes aproximadas 1400 x 700 x 2000 mm, com revestimento externo em chapa de aco inoxidavel AISI 304 - liga 18.8 e interno em aluminio STUCCO; isolamento termico em poliuretano, portas com fechamento por p'),
(48, 4110, '251001000053139', 'REFRIGERADOR modelo domestico, capacidade minima de 415 litros, tensao 127 volts, porta com prateleiras, na cor branca, sistema fost free, porta ovos, prateleiras internas, gavetas para vegetais, carnes e frios, congelador, lampada interna, nao usar no si'),
(49, 4110, '251001000053159', 'REFRIGERADOR hospitalar, horizontal para conservacao de vacinas, gabinete externo em chapa de aco esmaltada c/tampa externa provida de gaveta e 4 tampas internas em fibra especial, sobre 4 recipientes em aco inox c/controle de temperatura automatico siste'),
(50, 4110, '251001000053179', 'FRIGOBAR, capacidade minima 80 litros, tensao 110/220 volts, congelador, prateleiras deslizantes e removiveis com total aproveitamento, gaveta para legumes, porta reversivel.'),
(51, 4110, '251001000053219', 'FREEZER, capacidade minima 310 litros, vertical, tensao 127 volts, contendo cestos deslizantes e removiveis, com frontais transparentes, porta reversivel, na cor branca.'),
(52, 4110, '251001000053239', 'FREEZER, capacidade minima de 410 litros, horizontal, tensao 127 volts com 02 tampas, puxadores anatomicos com fechaduras, termostato dupla funcao (congelador ou conservador), rodizios de nylon, na cor branca.'),
(53, 4110, '251001000053259', 'REFRIGERADOR, capacidade minima de 280 litros, tensao 220 volts, porta com prateleiras, na cor branca, porta ovos, prateleiras internas, gavetas para vegetais, carnes e frios, congelador, lampada interna, nao usar no sistema de refrigeracao o gas CFC, com'),
(54, 4110, '251001000053279', 'REFRIGERADOR, modelo domestico, duplex, capacidade total liquida minima de 360 litros, porta totalmente aproveitavel, prateleiras removiveis e regulaveis, gaveta para carne e frios, gavetao para legumes com rodizios, nao utilizar gas CFC, na cor branca, t'),
(55, 4110, '251001024630729', 'VENTILADOR de teto, com exaustor e luminaria com 01 lampada, 04 (quatro) pas metalicas, velocidade minima de 180 rpm, area de ventilacao de no minimo 20 metros quadrados, baixo nivel de ruido, minimo de 03 velocidades, diametro minimo de 110 cm, tensao de'),
(56, 4110, '251001246307019', 'FREEZER,capacidade minima de 260 litros, vertical, tensao 220 volts, contendo cestos deslizantes e removiveis com frontais transparentes, porta reversivel, na cor branca.'),
(57, 4110, '251001246307039', 'DESCONGELADOR, aco inoxidavel AISI 304 tipo 18.8, contendo 01 tanque com chuveiro, fundo duplo perfurado, estrutura em aco carbono, pes em aco inox AISI 304 tipo 18.8, diametro 25mm e sapata de nivelamento, dimensoes 600 x 1000 x 600mm.'),
(58, 4110, '251001246307049', 'BEBEDOURO eletrico, tipo pressao, capacidade de refigeracao minima de 40 pessoas servidas por hora, gabinete totalmente confeccionado em chapa em aco inoxidavel, pia superior em aco inoxidavel polido, duas torneiras (para copo e para boca), torneira para'),
(59, 4110, '251001246307059', 'BEBEDOURO eletrico, tipo pressao, capacidade de refigeracao minima de 40 pessoas servidas por hora, gabinete totalmente confeccionado em chapa em aco inoxidavel, pia superior em aco inoxidavel polido, duas torneiras (para copo e para boca), torneira para'),
